import axios from 'axios';

const API_URL = 'http://localhost:5001';

const api = {
  // Room related APIs
  getRooms: () => axios.get(`${API_URL}/api/rooms`),
  getRoom: (id) => axios.get(`${API_URL}/api/rooms/${id}`),
  createRoom: (data) => axios.post(`${API_URL}/api/rooms`, data),
  updateRoom: (id, data) => axios.put(`${API_URL}/api/rooms/${id}`, data),
  deleteRoom: (id) => axios.delete(`${API_URL}/api/rooms/${id}`),
};

export default api;
